import React, { Component } from 'react';
import { AppContext } from '../provider/StateProvider';
import './dashboard.css';

export default class Dashboard extends Component {
  render() {
    //
    let { incoming, outgoing } = AppContext.context;
    //
    return (
      <div className="card">
        <h1>
          <AppContext.Consumer>
            {context => context.person.name}
          </AppContext.Consumer>
          <br />
          <AppContext.Consumer>
            {context => context.person.surname}
          </AppContext.Consumer>
          <AppContext.Consumer>
            {context => context.person.transactions}
          </AppContext.Consumer>
        </h1>
      </div>
    );
  }
}
